    init()
    {
        //creating directory mentioned in options.resultImagePath if not exists
        //разбиваем путь на куски и создаем нужную папку с вложенностями
        if(!fs.existsSync(this.savePath)) {
            this.savePath.split(path.sep).forEach((dir, index, splits) => {
                const parentDir = splits.slice(0, index).join(path.sep);
                const dirPath = path.resolve(parentDir, dir);
                if (!fs.existsSync(dirPath)) {
                    fs.mkdirSync(dirPath);
                }
            });
        }

    }

    /**
     * Обрезать изображение, с параметрами, переданными в процентах
     * @param bitmapPath
     * прямоугольник:
     * @param x - отступ от левого края
     * @param y - отступ от верхнего края
     * @param w - ширина
     * @param h - высота
     */
    async cropPercentDimToBitmap(bitmapPath,x,y,w,h,imagePath,imageName)
    {
        let fileDescriptor = await Jimp.read(bitmapPath);
        if((!isNaN(x)) && (!isNaN(y)) && (!isNaN(w)) && (!isNaN(h)))
        {
            try {
                this.imageName = `cropped_on_${moment().format('MMMMDD_YYYY_hhmmss')}_${Math.round(Math.random() * 99 + 1)}.jpg`;
                this.fullPathName = path.join(this.savePath, this.imageName);

                const realWidth = fileDescriptor.bitmap.width;
                const realHeight = fileDescriptor.bitmap.height;
                //console.log('ready to crop...');
                //console.log(`crop factor is: ${cropFactor}`);
                const x_Px = Math.trunc(x * realWidth / 100);//берем целое число, чтобы не выйти за границы при случае, когда выделяется правый верхний край
                const y_Px = Math.trunc(y * realHeight / 100);
                const w_Px = Math.trunc(w * realWidth / 100);
                const h_Px = Math.trunc(h * realHeight / 100);
                console.log(`selected dimensions: x_offset:${x_Px} px; ${y_Px} px; width: ${w_Px}; height: ${h_Px}`);
                let croppedImage = await fileDescriptor.crop(x_Px, y_Px, w_Px, h_Px);
                let savedImage = await croppedImage.write(this.fullPathName);
                console.log(`saved in: ${this.fullPathName}`);
                //await this.cropBase64ToBitmap(debugBase64);
                return {
                    saved: true,
                    cropped: this.fullPathName
                }
            }
            catch (exception)
            {
                console.log(exception);
                return {
                    saved:false
                }
            }
        }
        else
        return{
            saved:false
        }
    }
    async cropBase64ToBitmap(base64String,pathToFile)
    {
        function asyncWriteFILEBASE64(filePath,buffer) {
            return new Promise((resolve,reject)=>{
                fs.writeFile(filePath,buffer,(error,result)=>{
                    if(error)
                    {
                        reject(error);
                    }
                    else
                    {
                        resolve(result);
                    }
                });
            });
        }
        try {
            let buf = new Buffer(base64String, 'base64');
            //проверяем директорию на существование....
            if(!fs.existsSync(pathToFile)) {
             pathToFile.split(path.sep).forEach((dir, index, splits) => {
             const parentDir = splits.slice(0, index).join(path.sep);
             const dirPath = path.resolve(parentDir, dir);
             if (!fs.existsSync(dirPath)) {
             fs.mkdirSync(dirPath);
             }
             });
             }
            const imageName = pathToFile + path.sep + `${Date.now()}_${_.random(1, 1000)}.jpg`;
            await asyncWriteFILEBASE64(imageName, buf);
            //let fd = pify(fs.writeFile)(imageName,buf);
            //console.log(`writing file result:${fd}`);
            return true;
        }
        catch(e)
        {
            return e;
        }
    }

